import React from 'react';

const Card = ({card, onCardClick, onCardLike, onCardDelete}) => {
    const handleLikeClick = () => {
        onCardLike(card);
    }

    const handleDeleteClick = () => {
        onCardDelete(card);
    }

    const handleClick = () => {
        onCardClick(card);
    }

    return (
        <li className="card">
            <button type="button" className="card__button-delete" onClick={handleDeleteClick}/>
            <img className="card__picture" src={card.link} alt={card.name} onClick={handleClick}/>
            <div className="card__info">
              <h2 className="card__name">{card.name}</h2>
              <div className="card__like-container">
              <button type="button" className="button card__button-like" aria-label="like" onClick={handleLikeClick}/>
              <span className="card__like-counter">{card.likes.length}</span>
            </div>
            </div>
        </li> 

    );

}

export default Card;
